import React from 'react';
import '../css/About.css';

const About = () => {
    return (
        <div>
            <div className="about-background">
                <div className="about-us-text">
                    <h1>About Us</h1>
                        <p>
                        At Andersson's Car Rentals, we take pride in our decades-long commitment to excellence. 
                        Since our birth in the 1991s, we’ve been more than just a car rental service – we’re your reliable coding/travel companion. 
                        Why Choose Andersson's Rental? Because effieciency is my middle name.
                        </p>
                </div>
            </div>
        </div>
    );
};

export default About;
